import React from 'react';
import './style.css'
import { useState } from 'react';

function Square({vlaue, onSquareclick}){
    return(
        <button onClick={onSquareclick} className='square'>{vlaue}</button>
    )
}
function handleClick(i){
    const nextSqares = squares.slice();
    nextSqares[i] = 'x'
    setSquares(nextSqares)
}


function Board() {
    const [squares, setSquares] = useState(Array(9).fill(null))
    return (
        <div>
            <div className='board-row'>
                <Square vlaue={squares[0]} onSquareClick={() => handleClick(0)}/>
                <Square vlaue={squares[1]} onSquareClick={() => handleClick(1)}/>
                <Square vlaue={squares[2]} onSquareClick={() => handleClick(2)}/>
            </div>
            <div className='board-row'>
                <Square vlaue={squares[3]} onSquareClick={() => handleClick(3)}/>
                <Square vlaue={squares[4]} onSquareClick={() => handleClick(4)}/>
                <Square vlaue={squares[5]} onSquareClick={() => handleClick(5)}/>
            </div>
            <div className='board-row'>
                <Square vlaue={squares[6]} onSquareClick={() => handleClick(6)}/>
                <Square vlaue={squares[7]} onSquareClick={() => handleClick(7)}/>
                <Square vlaue={squares[8]} onSquareClick={() => handleClick(8)}/>
            </div>
        </div>
    )
  }

  export default function App(){
    return(
        <Board/>
    )
  }
